performance.`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"setting-up-the-cache"}}>{`Setting up the Cache`}</MDXTag>
<MDXTag name="p" components={components}>{`In your `}<MDXTag name="inlineCode" components={components} parentName="p">{`.env`}</MDXTag>{` you'll need to set the following variables to use caching:`}</MDXTag>
<MDXTag name="p" components={components}><MDXTag name="inlineCode" components={components} parentName="p">{`CACHE_ENABLE=true`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}><MDXTag name="inlineCode" components={components} parentName="p">{`DEFAULT_TTL_SEC=300`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}><MDXTag name="inlineCode" components={components} parentName="p">{`REDIS_URL=redis://10.200.10.1:6379`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"usage"}}>{`Usage`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-js"}}>{`// TODO: Add docs on cache usage
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
